import ReactDOM from "react-dom";
import { BrowserRouter, Route, SSwitch, Switch } from "react-router-dom";

import "./index.css";
import App from "./App";
import Loginbox from "./Signup/Loginbox";

ReactDOM.render(
  <BrowserRouter>
    <Switch>
      <Route exact path="/" component={App} />
      <Route path="./Signup/Loginbox" component={Loginbox} />
    </Switch>
  </BrowserRouter>,
  document.getElementById("root")
);
